    return (
        <>
            <div class="login-bg d-flex">
                    <img src={require('./img/Group 27.png')}></img>

            <div class="bg-img position-absolute col-lg-2">
                <img src={require('./img/login-img 1.png')}></img>
            </div>
            </div>

        </>
    )

}

export default Login
